import { useEffect } from "react";
import DiaryEditor from "../components/DiaryEditor";


const New = () => {
    useEffect(() => {
        const titleElement = document.getElementsByTagName("title")[0];
        titleElement.innerHTML = `Emotion Diary - New Diary`;
      }, []);
    return(
        <div>
            <DiaryEditor />
        </div>
    );
};

export default New;
